import PostItem from "./PostItem";
import posts from "./posts.json"
import PostSummaryItem from "../PostSummaryList/PostSummaryItem";

const PostList = () => {
    return (
        <ul className="list-group">
            {
                posts.map(p => {
                    return (PostItem(p));
                })
            }
        </ul>
    );
}
export default PostList;
